import React from 'react';

function ResultTable({ results }) {
    // If results is null or undefined, return null to render nothing
    if (!results) return null;

    return (
        <div className="result-table">
            <h2>Route Results</h2>
            <table>
                <thead>
                    <tr>
                        <th>Route</th>
                        <th>Distance (miles)</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td>{results.path?.join(' -> ') || 'No route found'}</td>
                        <td>{results.distance || 'N/A'}</td>
                    </tr>
                </tbody>
            </table>
        </div>
    );
}

export default ResultTable;
